const items = $input.all();
const signals = [];

for (const item of items) {
  const data = item.json;

  // Îß§Ïàò Ï°∞Í±¥ ÌôïÏù∏
  const buyConditions = data.entry_conditions?.buy || [];
  let buySignal = false;

  // TODO: Ïã§Ï†ú ÏßÄÌëú Í∏∞Î∞ò Ï°∞Í±¥ ÌôïÏù∏ (ÌòÑÏû¨Îäî Í∞ÑÎã®Ìïú ÏòàÏãú)
  // Ïã§Ï†úÎ°úÎäî RSI, MACD Îì± Í≥ÑÏÇ∞ ÌïÑÏöî
  if (buyConditions.length > 0) {
    // Ïòà: 3% Ïù¥ÏÉÅ ÌïòÎùΩ Ïãú Îß§Ïàò
    if (data.change_rate < -3) {
      buySignal = true;
    }
  }

  // Îß§ÎèÑ Ï°∞Í±¥ ÌôïÏù∏ (Î≥¥Ïú† Ï¢ÖÎ™©Îßå)
  // TODO: positions ÌÖåÏù¥Î∏î Ï°∞ÌöåÌïòÏó¨ Ïã§Ï†ú Î≥¥Ïú† Ïó¨Î∂Ä ÌôïÏù∏
  const sellConditions = data.exit_conditions?.sell || [];
  let sellSignal = false;

  if (sellConditions.length > 0) {
    // Ïòà: 5% Ïù¥ÏÉÅ ÏÉÅÏäπ Ïãú Îß§ÎèÑ
    if (data.change_rate > 5) {
      sellSignal = true;
    }
  }

  // Ïã†Ìò∏ ÏÉùÏÑ±
