const items = $input.all();
const results = [];

for (const item of items) {
  const signal = item.json;

  // Ï£ºÎ¨∏ Í∞ÄÍ≤© Ï†ÑÎûµ
  const strategy = signal.order_price_strategy[signal.signal_type];

  // Í∏∞Ï§Ä Í∞ÄÍ≤© ÏÑ†ÌÉù
  let basePrice = 0;

  switch (strategy.type) {
    case 'best_ask':
      basePrice = signal.sell_price;  // Îß§ÎèÑ 1Ìò∏Í∞Ä
      break;
    case 'best_bid':
      basePrice = signal.buy_price;   // Îß§Ïàò 1Ìò∏Í∞Ä
      break;
    case 'mid_price':
      basePrice = signal.current_price;  // Ï§ëÍ∞ÑÍ∞Ä
      break;
    case 'market':
      basePrice = null;  // ÏãúÏû•Í∞Ä
      break;
    default:
      basePrice = signal.signal_type === 'buy' ? signal.sell_price : signal.buy_price;
  }

  // offset Ï†ÅÏö©
  const orderPrice = basePrice ? Math.round(basePrice + (strategy.offset || 0)) : null;
  const orderMethod = basePrice === null ? 'MARKET' : 'LIMIT';

  console.log(`[${signal.signal_type}] ${signal.stock_code}: Í∏∞Ï§Ä=${basePrice}, offset=${strategy.offset}, Ï£ºÎ¨∏Í∞Ä=${orderPrice}`);

  results.push({
    json: {
      ...signal,
      order_price: orderPrice,
      order_method: orderMethod
    }
  });
}

return results;
